import React from 'react';

// Components
import Header from './components/Header/Header';
import Slider from './components/Slider/Slider';

// CSS
import classes from './App.module.css';

function App() {
  return (
    <div className={classes.App}>
      <Header/>
      <Slider/>
    </div>
  );
}

export default App;
